&quot;COMO RESULTADO DEL PROCESO DE SELECCIÓN, SU HOGAR ACTUALMENTE SE ENCUENTRA EN ESTADO REGISTRADO, LO CUAL QUIERE DECIR QUE HA SIDO SELECCIONADO COMO POTENCIAL BENEFICIARIO DEL PROGRAMA DEVOLUCIÓN DEL IVA, Y ESTÁ INCLUIDO EN EL SISTEMA DE INFORMACIÓN. 
EL PROCESO DE SELECCIÓN DE BENEFICIARIOS DEL PROGRAMA DEVOLUCIÓN DEL IVA PARA CADA CICLO OPERATIVO CORRESPONDE A UN ORDENAMIENTO DEL NIVEL DE VULNERABILIDAD Y DE LA DISPONIBILIDAD DE LOS RECURSOS PARA SETECIENTOS MIL HOGARES, SIN EMBARGO, DEBIDO AL ESTADO QUE PRESENTA, NO ES SUSCEPTIBLE DE ENTREGA DE TRANSFERENCIA POR LO QUE LE RECOMIENDO ESTAR PENDIENTE A LOS CANALES DE ATENCIÓN EN FUTUROS CICLOS DE ENTREGA.

&quot;

&quot;ES FUNDAMENTAL CUMPLIR CON LAS CORRESPONSABILIDADES PARA EVITAR LA SUSPENSIÓN EN EL CICLO DE VERIFICACIÓN CORRESPONDIENTE.

DURANTE EL CICLO 4, ES FUNDAMENTAL QUE LOS NIÑOS Y NIÑAS MENORES DE 6 AÑOS CUENTEN CON SU ESQUEMA DE VACUNACIÓN COMPLETO Y HAYAN RECIBIDO LAS ATENCIONES EN SALUD REQUERIDAS. 

ADEMÁS, ES IMPORTANTE RECORDAR QUE TODOS LOS HOGARES DEBEN CUMPLIR CON CIERTAS CORRESPONSABILIDADES EN SALUD. ESTAS INCLUYEN GARANTIZAR QUE EL ESQUEMA DE VACUNACIÓN ESTE COMPLETO PARA LOS NIÑOS Y NIÑAS MENORES DE 6 AÑOS. QUE LOS MENORES DE 6 AÑOS Y LAS PERSONAS CON DISCAPACIDAD QUE NECESITEN CUIDADOR RECIBAN AL MENOS DOS (2) ATENCIONES MÉDICAS AL AÑO, VERIFICAR QUE TODOS LOS INTEGRANTES DEL HOGAR ESTÉN AFILIADOS A UNA EPS OFICIAL, Y MANTENER ACTUALIZADA LA INFORMACIÓN DE AFILIACIÓN AL SISTEMA DE SALUD. &quot;

&quot;LE INFORMAMOS QUE EL CAMBIO DE MUNICIPIO DE PAGO SOLO PUEDE REALIZARSE HACIA UN MUNICIPIO VECINO. ESTA SOLICITUD SE GESTIONARA ÚNICAMENTE CUANDO HAY RAZONES RELACIONADAS CON LA DISTANCIA O LA DISPERSIÓN GEOGRÁFICA DEL LUGAR DONDE VIVE ACTUALMENTE. EL OBJETIVO ES FACILITARLE EL ACCESO AL PUNTO DE PAGO MÁS CERCANO.
SI DESEA SOLICITAR ESTE CAMBIO, DEBE ACERCARSE PERSONALMENTE AL ENLACE MUNICIPAL DONDE FUE SELECCIONADO Y ENTREGAR UNA SOLICITUD POR ESCRITO EN LA OFICINA DEL PROGRAMA. UNA VEZ RECIBIDA, EL PROGRAMA REVISARÁ LA INFORMACIÓN E INDICARÁ SI ES VIABLE O NO LO APROBACIÓN.
IMPORTANTE: SI USTED ES BENEFICIARIO CON SISBÉN EN LA CIUDAD DE BOGOTÁ, ESTA OPCIÓN NO ESTÁ DISPONIBLE, YA QUE LA CIUDAD CUENTA CON SUFICIENTES PUNTOS DE PAGO PARA SU ATENCIÓN&quot;

