&quot;COMO RESULTADO DEL PROCESO DE SELECCIÓN, SU HOGAR ACTUALMENTE SE ENCUENTRA EN ESTADO REGISTRADO, LO CUAL QUIERE DECIR QUE HA SIDO SELECCIONADO COMO POTENCIAL BENEFICIARIO DEL PROGRAMA DEVOLUCIÓN DEL IVA, Y ESTÁ INCLUIDO EN EL SISTEMA DE INFORMACIÓN. 
EL PROCESO DE SELECCIÓN DE BENEFICIARIOS DEL PROGRAMA DEVOLUCIÓN DEL IVA PARA CADA CICLO OPERATIVO CORRESPONDE A UN ORDENAMIENTO DEL NIVEL DE VULNERABILIDAD Y DE LA DISPONIBILIDAD DE LOS RECURSOS PARA SETECIENTOS MIL HOGARES, SIN EMBARGO, DEBIDO AL ESTADO QUE PRESENTA, NO ES SUSCEPTIBLE DE ENTREGA DE TRANSFERENCIA POR LO QUE LE RECOMIENDO ESTAR PENDIENTE A LOS CANALES DE ATENCIÓN EN FUTUROS CICLOS DE ENTREGA.

&quot;

&quot;
PROSPERIDAD SOCIAL INFORMA QUE, DEBIDO A LA ALTA CANTIDAD DE POSTULACIONES RECIBIDAS Y CON EL OBJETIVO DE REALIZAR UNA REVISIÓN MINUCIOSA Y TRANSPARENTE DEL CUMPLIMIENTO DE LOS REQUISITOS ESTABLECIDOS EN LOS TÉRMINOS DE REFERENCIA, LA PUBLICACIÓN DE LOS SELECCIONADOS NO SE LLEVÓ A CABO EL DÍA 4 DE JULIO, COMO ESTABA INICIALMENTE PREVISTO.
ACTUALMENTE, NOS ENCONTRAMOS EN LA ETAPA DE REVISIÓN DE REQUISITOS Y DOCUMENTOS, CON EL FIN DE ADELANTAR EL PROCESO DE SUBSANACIÓN. ESTA FASE PERMITIRÁ A LOS POSTULANTES COMPLETAR LA INFORMACIÓN REQUERIDA, GARANTIZANDO ASÍ UN PROCESO MÁS JUSTO, PARTICIPATIVO Y EQUITATIVO.

LA NUEVA FECHA PARA LA PUBLICACIÓN DE LOS RESULTADOS SERÁ INFORMADA OPORTUNAMENTE A TRAVÉS DE NUESTROS CANALES INSTITUCIONALES. POSTERIORMENTE, SE DARÁ INICIO AL PROCESO DE ENTREGA DE LOS ROLLOS DE TELA, EN COORDINACIÓN CON LAS GERENCIAS REGIONALES Y ALIADOS ESTRATÉGICOS, ASEGURANDO QUE LOS INSUMOS LLEGUEN A QUIENES CUMPLAN CON LA TOTALIDAD DE LOS REQUISITOS Y CUENTEN CON LA CAPACIDAD DE APROVECHARLOS EN EL FORTALECIMIENTO DE SUS ACTIVIDADES PRODUCTIVAS.

LE INVITAMOS A ESTAR PENDIENTE A NUESTROS CANALES OFICIALES DE COMUNICACIÓN, DONDE SE PUBLICARÁN LAS FECHAS Y DETALLES RELACIONADOS CON LA ENTREGA DE INSUMOS A LOS EMPRENDIMIENTOS SELECCIONADOS.&quot;

&quot;RENTA JOVEN ES UN PROGRAMA DE PROSPERIDAD SOCIAL QUE BUSCA LA INCLUSIÓN SOCIAL Y ECONÓMICA DE JÓVENES EN POBREZA Y VULNERABILIDAD. SU OBJETIVO ES FACILITAR EL ACCESO Y LA PERMANENCIA EN LA EDUCACIÓN SUPERIOR DE LOS JÓVENES DEL PAÍS, ADEMÁS DE FORTALECER LAS TRAYECTORIAS DE VIDA MEDIANTE LA ENTREGA DE TRANSFERENCIAS MONETARIAS.

ACTUALMENTE NO HAY CONVOCATORIAS ABIERTAS PARA INSCRIPCIONES DEBIDO A LA ASIGNACIÓN PRESUPUESTAL DE 2025. CUALQUIER NOVEDAD SERÁ INFORMADA A TRAVÉS DE LOS CANALES OFICIALES DE PROSPERIDAD SOCIAL.

LE INVITAMOS A MANTENER ACTUALIZADOS LOS DATOS DE SU HOGAR EN SU CENSO POBLACIONAL CON SU AUTORIDAD INDÍGENA, SISBÉN IV O ICBF, SEGÚN APLIQUE Y ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

COMPRENDO, SEGÚN LA INFORMACIÓN QUE USTED ME ENVÍA, ESTA NO CORRESPONDE A NINGÚN PROGRAMA DE PROSPERIDAD SOCIAL YA QUE INDICA INGRESO MÍNIMO GARANTIZADO, ADICIONAL INDICA QUE ES PARA LA CIUDAD DE BOGOTÁ. 

&quot;ESTA INICIATIVA HACE PARTE DE LAS TRANSFERENCIAS MONETARIAS CONDICIONADAS QUE ENTREGA LA SECRETARÍA DISTRITAL DE INTEGRACIÓN SOCIAL (SDIS) DE BOGOTÁ A HOGARES CON NIÑOS, NIÑAS Y ADOLESCENTES EN SITUACIÓN DE VULNERABILIDAD. SU PROPÓSITO ES INCENTIVAR LA ASISTENCIA REGULAR A JARDINES INFANTILES DEL DISTRITO Y A COLEGIOS OFICIALES.&quot;

POR LO ANTERIOR, LAMENTO INFORMARLE QUE PROSPERIDAD SOCIAL NO MANEJA INFORMACIÓN DEL PROGRAMA U AYUDA QUE SOLICITA, PARA MAYOR INFORMACIÓN LE RECOMIENDO QUE POR FAVOR VALIDE CON LA ALCALDÍA DE SU MUNICIPIO.

&quot;RENTA JOVEN ES UN PROGRAMA DE PROSPERIDAD SOCIAL QUE BUSCA LA INCLUSIÓN SOCIAL Y ECONÓMICA DE JÓVENES EN POBREZA Y VULNERABILIDAD. SU OBJETIVO ES FACILITAR EL ACCESO Y LA PERMANENCIA EN LA EDUCACIÓN SUPERIOR DE LOS JÓVENES DEL PAÍS, ADEMÁS DE FORTALECER LAS TRAYECTORIAS DE VIDA MEDIANTE LA ENTREGA DE TRANSFERENCIAS MONETARIAS.

ACTUALMENTE NO HAY CONVOCATORIAS ABIERTAS PARA INSCRIPCIONES DEBIDO A LA ASIGNACIÓN PRESUPUESTAL DE 2025. CUALQUIER NOVEDAD SERÁ INFORMADA A TRAVÉS DE LOS CANALES OFICIALES DE PROSPERIDAD SOCIAL.

LE INVITAMOS A MANTENER ACTUALIZADOS LOS DATOS DE SU HOGAR EN SU CENSO POBLACIONAL CON SU AUTORIDAD INDÍGENA, SISBÉN IV O ICBF, SEGÚN APLIQUE Y ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

TENGA EN CUENTA QUE, SEGÚN LO ESTABLECIDO EN LOS DECRETOS 1522 Y 1523 DE 2024, SE DEFINIÓ UNA REDUCCIÓN DEL PRESUPUESTO PARA EL AÑO 2025. COMO RESULTADO, EL PROGRAMA RENTA CIUDADANA ÚNICAMENTE PRIORIZARÁ LA LÍNEA DE INTERVENCIÓN “VALORACIÓN DEL CUIDADO”.
AL VALIDAR LA INFORMACIÓN DE SU HOGAR, SE IDENTIFICA QUE SE ENCUENTRA REGISTRADO EN UNA LÍNEA DE INTERVENCIÓN NO DEFINIDA, YA QUE NO CUMPLE CON LOS SIGUIENTES REQUISITOS: NO HAY MENORES DE 6 AÑOS. MIENTRAS ESTA SITUACIÓN PERSISTA, EL HOGAR NO RECIBIRÁ NUEVAS TRANSFERENCIAS
LE INVITAMOS A ESTAR PENDIENTE DE NUESTROS CANALES OFICIALES DE ATENCIÓN: TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES. PARA MANTENERSE INFORMADO(A) Y VALIDAR CUALQUIER NOVEDAD RELACIONADA CON SU ESTADO EN EL PROGRAMA.&quot;

&quot;EL PROGRAMA BUSCA FORTALECER LOS NEGOCIOS DE LA ECONOMÍA POPULAR, COMUNITARIA Y SOLIDARIA MEDIANTE ACOMPAÑAMIENTO, ASISTENCIA TÉCNICA Y LA ENTREGA DE ACTIVOS E INSUMOS PRODUCTIVOS. SU OBJETIVO ES MEJORAR LOS INGRESOS DE LA POBLACIÓN EN SITUACIÓN DE POBREZA Y VULNERABILIDAD, REDUCIR BRECHAS DE INEQUIDAD Y FOMENTAR EL DESARROLLO ECONÓMICO.
ESTÁ DIRIGIDO A VENDEDORES AMBULANTES, PERSONAS CON MICRONEGOCIOS EN EL HOGAR, RECICLADORES, PEQUEÑOS AGRICULTORES, PEQUEÑOS PRODUCTORES, JÓVENES, MUJERES CABEZA DE HOGAR, AFROCOLOMBIANOS, CAMPESINOS, VÍCTIMAS DEL CONFLICTO ARMADO, PERSONAS CON DISCAPACIDAD, FAMILIAS, ORGANIZACIONES COMUNITARIAS Y SOLIDARIAS, ENTRE OTROS.
ACTUALMENTE NO HAY CONVOCATORIA, LE INVITAMOS A ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, REDES SOCIALES Y LA PÁGINA HTTPS://PROSPERIDADSOCIAL.GOV.CO/ECONOMIA-POPULAR-PARA-EL-CAMBIO/ &quot;

